Brewed by: Carbon Brews x Coco Espresso
Style: Stout
ABV: 5.2%

Appearance: Smooth dull black, pale brown head and nice lacing but short retention
Nose: Strong aroma of freshly roasted coffee beans with hint of dark chocolate and biscuit
Flavor: Simply but beautifully espresso in the front and soon transits into bittersweet dark chocolate and little liquorice comes back at the aftertaste
Mouthfeel: Light body with fairly low carbonation, dry but not as much as a typical Irish Stout

Overall: My second favorite beer among Carbon Brews' range is back to town! As it suggests it is basically an americano for the intense coffee note in the beer. I would say this batch is even roastier than the previous version but not charred, and thus overwhelmed the bitterness from the hops. Surprisingly milky character shows up after some time and balances out some of the dryness. Still very light bodied and easy drinking, I can drink this all day!

